// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

contract Fit2Earn {
    struct User {
        uint256 steps;
        uint256 heartRate;
        uint256 bloodPressure;
        uint256 rewards;
        bool registered;
    }

    mapping(address => User) public users;
    address public owner;
    uint256 public rewardPerStep = 1; // Example: 1 token per step

    event UserRegistered(address indexed user);
    event HealthUpdated(address indexed user, uint256 steps, uint256 heartRate, uint256 bloodPressure);
    event RewardsClaimed(address indexed user, uint256 amount);

    constructor() {
        owner = msg.sender;
    }

    modifier onlyRegistered() {
        require(users[msg.sender].registered, "User not registered");
        _;
    }

    function registerUser() external {
        require(!users[msg.sender].registered, "User already registered");
        users[msg.sender] = User(0, 0, 0, 0, true);
        emit UserRegistered(msg.sender);
    }

    function updateHealthData(uint256 newSteps, uint256 heartRate, uint256 bloodPressure) external onlyRegistered {
        users[msg.sender].steps += newSteps;
        users[msg.sender].heartRate = heartRate;
        users[msg.sender].bloodPressure = bloodPressure;
        users[msg.sender].rewards += newSteps * rewardPerStep; // Reward Calculation
        emit HealthUpdated(msg.sender, newSteps, heartRate, bloodPressure);
    }

    function getUserData(address user) external view returns (uint256 steps, uint256 heartRate, uint256 bloodPressure, uint256 rewards) {
        require(users[user].registered, "User not registered");
        User memory u = users[user];
        return (u.steps, u.heartRate, u.bloodPressure, u.rewards);
    }

    function claimRewards() external onlyRegistered {
        uint256 rewards = users[msg.sender].rewards;
        require(rewards > 0, "No rewards to claim");
        users[msg.sender].rewards = 0;
        emit RewardsClaimed(msg.sender, rewards);
        payable(msg.sender).transfer(rewards); // Sending ETH as rewards (Replace with Token transfer if needed)
    }

    receive() external payable {} // Allow contract to receive ETH
}

